import React, { Component } from 'react';

import { Row, Col} from 'react-materialize';

import './footerSite.css';

import LogoSite from '../../images/logo/LogoSite.png';

//<div className="divText">
//				<p className="grey-text text-lighten-4">"Não vendemos apenas ingressos, vendemos experiências"</p>
//			</div>

const FooterSite = () => (
	<Row className="rowFooter">
	    <footer className='footero'  >
	    	<Col s={4}>
		    	<Col s={8} m={8} offset="s2 m2" >
	          		<img src={LogoSite} className="responsive-img"/> 
	          	</Col>
		    </Col>
		    <Col s={3}></Col>
		    <Col s={5}>
			    <ul>
			      <li><a className="grey-text text-lighten-3" href="/">  Home  </a></li>
			      <li><a className="grey-text text-lighten-3" href="">  Formas de Pagamento  </a></li>
			      <li><a className="grey-text text-lighten-3" href="">  Sobre nós  </a></li>
			    </ul>
			</Col>
			
		</footer>
	</Row>
);

export default FooterSite;
